import { createContext } from "react";

const ApplicantContext = createContext()

export const staff = ({ children }) => {
    const [isStaff, setIsStaff] = useState(false);
  
    return (
      <ApplicantContext.Provider value={{ isStaff, setIsStaff }}>
        {children}
      </ApplicantContext.Provider>
    );
  };
  
  export const staffcontext = () => useContext(ApplicantContext);
